import { BrowserRouter } from 'react-router-dom';
import NavBar from './navBar/NavBar.js'
import styles from './cssPage/potfolio.module.css'
import backgroundImg from ''
function App() {
  return (
    <BrowserRouter>
      <div  className={styles.tagline} >
        <img src={'/image/bg'} alt=''/>

       <NavBar/>
      </div>
    </BrowserRouter>
  );
}

export default App;
